import "./Grid.css"
const Grid = ({ photos, username }) => {
    return (
        <div className="photo-grid">
            {photos.map((photo) => (
                <div key={photo.Id} className="photo-item">
                    <img src={photo.Url.Regular} />
                </div>
            ))}
        </div>
    );
};
export default Grid;
